about:
Опыт по направлениям и процессам:
- Организация проведения работ по контролю качества выпускаемой продукции;
- Умение управлять коллективом, обучение и мотивация сотрудников;
- Постановка задач, организация работы, контроль исполнения, ведение отчетности;
- Определение приоритетных направлений по улучшению качества продукции предприятия;
- Знание и определение необходимых средств измерений для обеспечения качества продукции на предприятии;
- Определение целей в области качества организации и структурных подразделений;
- Разработка планов по достижению целей в области качества и в производственной системы;
- Разработка политики предприятия в области качества;
- Разработка план графиков внутренних аудитов;
- Проведение  внутренних и внешних аудитов СМК;
- Обеспечение оценки результативности и проведение анализа процессов СМК;
- Изготовление продукции и контроль качества согласно ISO 9001 и ГОСТ РВ 0015-002;
- Разработка и актуализация стандартов предприятия;
- Определение номенклатуры измеряемых параметров и оптимальных норм точности измерений, выбор необходимых средств измерения;
- Написание и анализ рекламаций, изучение причин возникновения дефектов и нарушений технологии производства, ухудшения качества работ, выпуска брака и разработка предложений по их устранению;
- Оформление результатов контрольных операций, ведение учета показателей качества продукции, брака и его причин, составлению периодической отчетности о качестве выпускаемой продукции и выполняемых работ;
- Метрологическое обеспечение вооружения и военной техники по ГОСТ РВ 0008-003 и ГОСТ РВ 0008-000;
- Обеспечение единства измерений при выполнении ГОЗ согласно ГОСТ РВ 0008-001;
- Проведение входного контроля согласно ГОСТ РВ 0015-308;
- Изучение передового отечественного и зарубежного опыта по разработке и внедрению систем управления качеством;
- Обеспечение ритмичной и качественной приемки продукции на предприятии;
- Опыт гарантийной рекламационной работы и рекламационной работой с поставщиками (в том числе по ГОСТ РВ 0015-703); 
- Достижение плановых показателей;
- Оптимизация производственного процесса;
- Разработка программы мероприятий по совершенствованию деятельности организации;
- Большой и успешный опыт работы с военными представителями заказчика;
- Испытания и приёмка продукции по ГОСТ РВ 15.307;
- Успешный долголетний опыт работы на участках станков с ЧПУ, слесарно-сборочных, испытательных и заготовительных участках, - Большой опыт в написании техпроцессов и состовлении контрольных карт для проверки изделий.
- Оптимизация контроля качества продукции.
- Успешный опыт внедрения системы разработки и постановки продукции на производство по ГОСТ РВ 0015-301.
- Контроль и поддержание трудовой дисциплины;
- Организация и контроль соблюдения норм охраны труда;
- Уровень владения П.К. - продвинутый пользователь, знание программ Exel,Word,1C: Предприятие, Документооборот, Solid works, Компас, знание основ 3D моделирования, Corel;
- Опыт работ по программированию, на станках с ПУ : токарные ,гидроабразивные, гибочные, шлифовачные ,фрезерные;
- Инженер-програмист Координатно-измерительной машины ZEISS DuraMax (написание программ, измерение сложных деталей);
