Личные проекты

Работа в ООО «Автодор-инжиниринг»: аэрофотосъемка и частичная лидарная съемка а/д А-107, А-113, М-11, М-12. Вычисление объемов лесонасаждений с помощью БПЛА под вырубку для создания МФЗ на автомобильной дороге, создание нескольких 3D моделей, вантового моста через реку «Ока», расположенного на трассе М-12, во время проведения статических испытаний, для измерения деформации сооружения. Проведение теплосъемки с помощью БПЛА DJI Matrice 300 RTK с установленной камерой Zenmuse H20t. Обработка всех полученных данных с помощью ПО: Topodrone Post Processing, Agisoft Metashape pro, Bentley ContextCapture, Lidar 360, DJI Thermal Analysis Tool, Global Mapper. В итоге были созданы ортофотопланы и облака точек на необходимые участки а/д, которые в дальнейшем использовались для работы в других отделах компании. Обработка аэровидео мониторинга в программах Adobe Premiere Pro, Adobe After Effects.
Спектр задач выполняемых в компаниях: Проведение АФС ВЛС НЛС МЛС АВМ, работа над созданием автосимулятора, подсчет объемов лесной выруки, выполнение полевого геодезического и строительного контроля.
Съемка антенн и вышек сотовой связи по контракту с компанией Ericson. Целью данной съемки являлось создание: 3D модели вышки, спин модели каждого уровня антенн под тремя разными углами, съемка фидерной магистрали. Съемка производилась на квадрокоптерах DJI Phantom 4 pro V2 и DJI matrice 300 с установленной камерой Zenmuse H20t.

Самостоятельно реализовал проект по созданию ортофотоплана на территорию с площадью 80 гектаров. Съемка была осуществлена на DJI mavic 2 pro, было получено более 2000 фото в видимом диапазоне. Затем используя программу Agisoft Metashape были созданы следующие слои: связующие точки, плотное облако точек, карта высот, цифровая модель местности, ортофотоплан с пространственным разрешением 2 GSD.

